import React from 'react';
import { Link } from 'react-router-dom';
const Header = (props) => {
    return (
     <header>     
     <nav>
        <div className="logo">
            <Link to = "../src/images/logo7.png">MiLogo</Link>
        </div>
        <div className="nav-links">
            <Link to= "../src/components/Contacto.js">Contacto</Link>
            <Link to= "../src/components/SobreMi.js">Sobre Mi</Link>
            <Link to= "../src/components/Tienda.js">Tienda</Link>
            <Link to= "../src/components/Carrito.js">Carrito</Link>
        </div>
    </nav>             
     </header>
    )
}
export default Header;
